import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import './Fixed_3.css'

function Fixed_3() {
  return (
    <div>Fixed_3
        <div id="left">Fixed-width left</div>
         <div id="right">Dynamic right. Scroll me!</div>
    </div>
  )
}

export default Fixed_3
